import collections
from typing import Optional, Dict

from python.util.core import tree_util
from python.util.core.tree_util import TreeNode


class Solution:
    def diameterOfBinaryTree(self, root: Optional[TreeNode]) -> int:
        """
        T(n): O(n)
        S(n): O(n)
        计算二叉树的直径
        :param root:
        :return: int
        """
        if not root:
            return 0

        des_diameter = 0
        depth_dic: Dict[Optional[TreeNode], int] = collections.defaultdict(int)
        stack = [(root, False)]
        # 使用栈替换之前的递归调用
        while stack:
            node, visited = stack.pop()
            if node:
                if visited:
                    left_depth = depth_dic[node.left]
                    right_depth = depth_dic[node.right]
                    depth_dic[node] = 1 + max(left_depth, right_depth)
                    des_diameter = max(des_diameter, left_depth + right_depth)
                else:
                    # 后进先出，先处理右子树，再处理左子树，最后处理当前节点
                    stack.append((node, True))
                    stack.append((node.right, False))
                    stack.append((node.left, False))

        return des_diameter


